import React from 'react'
import { Container } from './compontents/index'
import {Header,InsuranceDepartments ,Footer ,ListOfFeaturesAndPrices } from './compontents/section/index';
import Navbar from './compontents/section/Header/Navbar/Navbar';
function Home() {
  return (
    <>
     <Header>
     <Navbar/>
    </Header>
    <Container>
      <InsuranceDepartments/>
      <ListOfFeaturesAndPrices/>
    </Container>
    <Footer/>
    </>
   
  )
}

export default Home
